import axios from 'axios'
import {getAll} from '../service';
import endPoint from '../config'
import { useEffect } from 'react';

const AllMessage = () => {
    useEffect(() => {
      (async () => {
        const {data:message} = await getAll(endPoint,'volunteerRouter');
        console.log(message);
      })()
    
      
    }, [])
    
  return (
    <div>
      
    </div>
  )
}

export default AllMessage
